import React, { useEffect, useState } from 'react';
import { request } from '../axios_helper';

function Profiles() {
  const [profiles, setProfiles] = useState([]);

  useEffect(() => {
    request('get', '/profiles')
      .then(response => {
        setProfiles(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div className="max-w-screen-xl mx-auto p-4 text-white">
      <h1 className="text-2xl font-bold mb-4">Мои профили</h1>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        {profiles.map(profile => (
          <div key={profile.id} className="bg-blue-500 rounded-lg p-4 shadow-xl">
            <div className="mb-2">
              <span className="font-bold">Адрес:</span> {profile.address}
            </div>
            <div className="mb-2">
              <span className="font-bold">Телефон:</span> {profile.telephone}
            </div>
            <div className="mb-2">
              <span className="font-bold">ФИО:</span> {profile.surname} {profile.firstname[0]}. {profile.patronymic[0]}.
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Profiles;
